<ul>
<li>存储型 XSS：恶意脚本存储在服务器</li>
<li>反射型 XSS：恶意脚本通过 URL 参数反射</li>
<li>DOM 型 XSS：恶意脚本通过 DOM 操作执行</li>
</ul>
